import React from 'react'
import styled from 'styled-components'
import {Container}  from 'react-bootstrap';

const Card = styled.p`
    border: 1px solid black;
    border-radius: 25%;

`;

const AboutCard = () => {
    return (
        <div>
            <Container>
            <Card>
                Hi my name is Lucas.
            </Card>
            </Container>
        </div>
    )
}

export default AboutCard
